issue.body:
Hi there. I'm having issues appending an OpenVino EP on a C# console app targeting .NET 5-windows.

I am invoking as 
`            SessionOptions options = new SessionOptions();
            string device= "CPU_FP32";
            options.GraphOptimizationLevel = GraphOptimizationLevel.ORT_ENABLE_ALL;
            options.AppendExecutionProvider_OpenVINO(device);
`
Crash happens on the append call. I am building from source using 
.\build.bat --config Release  --parallel --cmake_generator "Visual Studio 16 2019" --build_nuget  --use_openvino CPU_FP32 --build --update

OpenVINO version is 2021.3

but any version of config (Release, Debug, RelWithDebIngo), or any device ID, or any combination of --build --update etc results in the same behavior. I'm not sure if this is related, but the only two nugets that are generated with these configs are Microsoft.ML.OnnxRuntime.Managed, and Microsoft.ML.OnnxRuntime.OpenVINO, not Microsoft.ML.OnnxRuntime.

As a result, I can't test it on a CPP app either because the OpenVINO nuget does not define targets. Nor does it work with -build_wheel. I'm using the setupvars scrips and am using the latest openVINO library. I've kind of exhausted all possible avenues to debug this so I'm wondering if there's anyone who could assist. I've followed all the build instructions to a tee and still can't get this to work properly. Any help would be greatly appreciated!
